pragma solidity >=0.8.15 <0.9.0;

import "../lib/struct/LEnumerableSet.sol";
import "../lib/struct/LEnumerableMap.sol";
import "../proxy/BaseUUPSStorage.sol";

abstract contract AccessControlStorage is BaseUUPSStorage {
  using LEnumerableSet for LEnumerableSet.AddressSet;
  using LEnumerableSet for LEnumerableSet.Bytes32Set;
  using LEnumerableMap for LEnumerableMap.Bytes32ToBytes32Map;
  using LEnumerableMap for LEnumerableMap.AddressToUintMap;

  enum Status {
    NONE,
    ENABLED,
    DISABLED
  }

  struct RoleStat {
    bytes32 role;
    Status status;
  }

  struct Context {
    bytes32 realm;
    address smca; // smart contract address
    bool isEnabled;
    mapping(bytes4 => RoleStat) resources; // function selector => RoleStat
    LEnumerableSet.Bytes32Set funcSet;
  }

  struct Role {
    string name;
    bytes32 group;
    bool isEnabled;
    LEnumerableSet.AddressSet accountSet;
  }

  struct Realm {
    string name;
    bool isEnabled;
    bool isUpgradable;
    LEnumerableSet.Bytes32Set ctxSet;
  }

  struct Group {
    string name;
    bool isEnabled;
    LEnumerableSet.Bytes32Set roleSet;
  }

  struct DataMaps {
    mapping(address => mapping(bytes32 => Status)) accountMap;
    mapping(bytes32 => Context) ctxMap;
    mapping(bytes32 => Role) roleMap;
    mapping(bytes32 => Realm) realmMap;
    mapping(bytes32 => Group) groupMap;
  }

  bytes32 internal constant _LIVELY_GENERAL_REALM = keccak256(abi.encodePacked("LIVELY_GENERAL_REALM"));
  bytes32 internal constant _LIVELY_GENERAL_GROUP = keccak256(abi.encodePacked("LIVELY_GENERAL_GROUP"));
  bytes32 internal constant _LIVELY_ADMIN_ROLE = keccak256(abi.encodePacked("LIVELY_ADMIN_ROLE"));
  bytes32 internal constant _LIVELY_SYSTEM_ADMIN_ROLE = keccak256(abi.encodePacked("LIVELY_SYSTEM_ADMIN_ROLE"));
  bytes32 internal constant _LIVELY_ANONYMOUS_ROLE = keccak256(abi.encodePacked("LIVELY_ANONYMOUS_ROLE"));

  DataMaps internal _dataMaps;
}
